import './App.css';
import Home from './components/Home';
import Navbar from './components/Navbar';
import { Link, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <>
    <Routes>
      <Navbar />
      <Route path='/' element={<Home />} />
      <Route path='/home' element={<Home />} />
    </Routes>
    </>
  );
}

export default App;
